import './HomeBanner.css';
import headphonesImg from '../assets/visuals/neon-headphones.webp';

function Home() {
return (
<div className="home">
<div className="home-hero">
<h1 className="home-hero-title neon-gradient">
TymoshchukMateStore
</h1>

<img
src={headphonesImg}
alt="Headphones showcase"
className="home-hero-img"
/>
</div>
</div>
);
}

export default Home;
